// Next.js API route support: https://nextjs.org/docs/api-routes/introduction
import type { NextApiRequest, NextApiResponse } from "next";

type Data = {
  result: string;
  message: string;
  requestData: any;
  image?: string;
};

const BASE_64_IMAGE: string = `data:image/png;base64,`;

export default function handler(req: NextApiRequest, res: NextApiResponse<Data>) {
  if (req.method === "POST") {
    res.status(200).json({ result: "200 success", requestData: req.body, message: "Image Output Generated", image: BASE_64_IMAGE });
  } else {
    res.status(403).json({ result: "403 error", requestData: req.body, message: "Not allowed method" });
  }
  return;
}
